INSERT INTO `noticiasgerais` VALUES (42,32,'IFSC C√¢mpus Florian√≥polis investe em acessibilidade e moderniza√ß√£o da infraestrutura','O C√¢mpus Florian√≥polis do Instituto Federal de Santa Catarina (IFSC) est√° passando por uma s√©rie de reformas e melhorias estruturais com foco em acessibilidade, seguran√ßa e moderniza√ß√£o dos espa√ßos acad√™micos. As obras incluem desde a instala√ß√£o de plataformas elevat√≥rias para cadeirantes at√© a substitui√ß√£o de pisos e adequa√ß√µes em banheiros e passarelas.','2025-07-06 23:47:17'),(43,32,'Alunos da do IFSC Gaspar passam para fase nacional OBEMEP','O C√¢mpus Gaspar do Instituto Federal de Santa Catarina (IFSC) est√° em festa! Tr√™s estudantes da unidade brilharam na edi√ß√£o de 2024 da Olimp√≠ada Brasileira de Matem√°tica das Escolas P√∫blicas (OBMEP) e foram reconhecidos por seu desempenho excepcional.','2025-07-06 23:48:43'),(44,32,'IFSC anuncia oito novos cursos para 2025 em diversas regi√µes de Santa Catarina','O Instituto Federal de Santa Catarina (IFSC) est√° ampliando sua oferta educacional com a cria√ß√£o de oito novos cursos previstos para iniciar no primeiro semestre de 2025. A iniciativa contempla diferentes n√≠veis de ensino ‚Äî t√©cnico, superior, p√≥s-gradua√ß√£o e EJA (Educa√ß√£o de Jovens e Adultos) ‚Äî e atende √† crescente demanda por qualifica√ß√£o profissional em v√°rias regi√µes do estado.\n\n','2025-07-06 23:50:08'),(45,32,'Partiu IF: preparando estudantes para ingressar no ensino t√©cnico federal','O Partiu IF √© um programa nacional que tem como objetivo ampliar as oportunidades de acesso de estudantes da rede p√∫blica ao ensino t√©cnico ofertado pelos Institutos Federais. No IFSC, a iniciativa est√° em pleno funcionamento em 2025, com 920 vagas distribu√≠das em 23 turmas em 19 c√¢mpus diferentes.\n\n','2025-07-06 23:52:19');
