INSERT INTO `projetos` VALUES (18,'A Est√©tica das Pequenas Coisas na Arte Contempor√¢nea Brasileira','Este projeto de pesquisa prop√µe uma investiga√ß√£o sobre como elementos do cotidiano ‚Äî objetos, gestos, rotinas e experi√™ncias comuns ‚Äî s√£o ressignificados e transformados em express√£o art√≠stica na arte contempor√¢nea brasileira. Atrav√©s da an√°lise de obras visuais, performances e instala√ß√µes de artistas que exploram a est√©tica do trivial, busca-se compreender como a arte se aproxima da vida real, revelando beleza, cr√≠tica e sensibilidade nas pequenas coisas.',2,'Edital PROPPI N¬∫ 04/2024','2024-04-12','2026-07-12','2026-10-20',1),(19,'Estudos de Personagem a Constru√ß√£o C√™nica a partir de Experi√™ncias Reais','O projeto tem como foco principal contribuir para o aprimoramento da forma√ß√£o art√≠stica, bem como explorar o teatro como espa√ßo de escuta, cura e transforma√ß√£o subjetiva.',1,'Edital PROPPI N¬∫ 03/2025','2025-04-10','2026-04-10',NULL,1),(20,'Fragmentos de Cena','O projeto ‚ÄúFragmentos em Cena‚Äù investiga a cria√ß√£o teatral a partir de recortes narrativos, mem√≥rias pessoais, imagens po√©ticas e viv√™ncias cotidianas que, juntos, comp√µem um mosaico de cenas fragmentadas.\n',2,'Edital PROPPI N¬∫ 06/2025','2025-06-12','2026-06-12',NULL,1),(21,'ARTE CICLO','O ARTE-CICLO √© um grupo interdisciplinar dedicado √† investiga√ß√£o te√≥rico-pr√°tica das rela√ß√µes entre arte, natureza e sustentabilidade no contexto contempor√¢neo.\n',1,'Edital PROPPI N¬∫ 08/2022','2022-08-20','2024-08-20',NULL,1),(22,'Entre Pigmentos e Possibilidades','Este projeto prop√µe uma abordagem interdisciplinar sobre o uso da tinta na produ√ß√£o art√≠stica, explorando sua materialidade, simbolismo e potencial expressivo.',1,'Edital PROPPI N¬∫ 01/2018','2018-03-20','2020-03-20',NULL,1),(23,'Escrita Criativa e Subjetividade','A proposta se concentra em processos de escrita criativa ‚Äî como poesia, cr√¥nicas, autobiografias e narrativas ficcionais ‚Äî que permitam aos estudantes experimentar a linguagem como espa√ßo de escuta, inven√ß√£o e pertencimento.',2,'Edital PROPPI N¬∫ 02/2022','2022-04-10','2023-10-30',NULL,1),(24,'Ambientes em Alerta','Por meio de oficinas, projetos de interven√ß√£o, atividades art√≠sticas e rodas de conversa, o projeto busca estimular a reflex√£o sobre os impactos das a√ß√µes humanas na natureza e fomentar atitudes sustent√°veis no contexto escolar e comunit√°rio.',2,'Edital PROPPI N¬∫ 05/2014','2014-05-20','2017-03-20',NULL,1),(25,'Cor e Resist√™ncia','Por meio da an√°lise de produ√ß√µes visuais, performances, express√µes populares e manifesta√ß√µes culturais de artistas racializados, busca-se compreender como a linguagem art√≠stica atua na desconstru√ß√£o de estere√≥tipos, na valoriza√ß√£o das identidades negras e na afirma√ß√£o da ancestralidade afro-brasileira.',1,'Edital PROPPI N¬∫ 10/2023','2023-10-20','2025-10-20',NULL,1),(26,'Grupo de Estudos em Gerontologia','O GERA √© um grupo de pesquisa interdisciplinar dedicado ao estudo do envelhecimento humano a partir da perspectiva da Gerontologia. O objetivo principal √© compreender os m√∫ltiplos fatores que impactam o processo de envelhecimento ‚Äî incluindo aspectos biol√≥gicos, psicol√≥gicos, sociais, culturais e tecnol√≥gicos ‚Äî e contribuir para a constru√ß√£o de pol√≠ticas p√∫blicas, a√ß√µes educativas e pr√°ticas inclusivas voltadas √† popula√ß√£o idosa.\n',2,'Edital PROPPI N¬∫ 12/2021','2022-03-20','2027-03-20',NULL,1);
